class Security:
    def __init__(self):
        self.public_key = b'''
'''

    def _genKeys(self):
        """Generate Public and Private Keys"""
        private_key = rsa.generate_private_key(
            public_exponent=65537,
            key_size=4096,
            backend=default_backend()
        )
        public_key = private_key.public_key()

        private_pem = private_key.private_bytes(
            encoding=serialization.Encoding.PEM,
            format=serialization.PrivateFormat.PKCS8,
            encryption_algorithm=serialization.NoEncryption()
        )

        with open('private_key.pem', 'wb') as f:
            f.write(private_pem)

        public_pem = public_key.public_bytes(
            encoding=serialization.Encoding.PEM,
            format=serialization.PublicFormat.SubjectPublicKeyInfo
        )
        with open('public_key.pem', 'wb') as f:
            f.write(public_pem)

    def encrypt(self, data: bytes):
        """Encrypt Bytes"""
        public_key = serialization.load_pem_public_key(
            self.public_key,
            backend=default_backend()
        )
        encrypted = base64.b64encode(public_key.encrypt(
            data,
            padding.OAEP(
                mgf=padding.MGF1(algorithm=hashes.SHA256()),
                algorithm=hashes.SHA256(),
                label=None
            )
        ))
        return encrypted

    def decrypt(self, data: bytes):
        """Decrypt Bytes"""
        with open("private_key.pem", "rb") as key_file:
            private_key = serialization.load_pem_private_key(
                key_file.read(),
                password=None,
                backend=default_backend()
            )
        decrypted = private_key.decrypt(
            base64.b64decode(data),
            padding.OAEP(
                mgf=padding.MGF1(algorithm=hashes.SHA256()),
                algorithm=hashes.SHA256(),
                label=None
            )
        )
        return decrypted

class Keybinds:
    def __init__(self):
        self.pause_resume = None
        self.vol_up = None
        self.vol_down = None
        self.mute = None

    def init_keybinds(self):
        if os.path.isfile('keybinds.json'):
            try:
                with open('keybinds.json') as of:
                    data = json.load(of)
                    #print(data)
                    for p in data['Config']:
                        self.pause_resume = p['pause_resume']
                        self.vol_up = p['vol_up']
                        self.vol_down = p['vol_down']
                        self.mute = None
                        return
            except Exception as e:
                print('Unable to load keybinds')
        data = {}
        data['Config'] = []
        data['Config'].append({
        'pause_resume': 'Key.media_play_pause',
        'vol_up': 'Key.media_volume_up',
        'vol_down': 'Key.media_volume_down',
        'mute': None
        })
        with open('keybinds.json', 'w+') as of:
            json.dump(data, of)
        try:
            with open('keybinds.json') as of:
                data = json.load(of)
                for p in data['Config']:
                    self.pause_resume = p['pause_resume']
                    self.vol_up = p['vol_up']
                    self.vol_down = p['vol_down']
                    self.mute = None
                    return
        except Exception as e:
            print('Unable to load keybinds')
        return

    def set_keybind(self, name, key):
        self.init_keybinds()
        with open('keybinds.json') as of:
            data = json.load(of)
            data['Config'][0][name] = key
            with open('keybinds.json', 'w+') as of:
                json.dump(data, of)

class SongThread(QObject):
    finished = pyqtSignal()
    progress = pyqtSignal(dict)
    def __init__(self, gid, parent = None):
        super(SongThread, self).__init__(parent)
        self.gid = gid
        self.API_ENDPOINT = 'https://tune.loona.gg/api/v1/'
        self.guild = 0
        self.songData = {}
        self.currentSong = None

    def run(self):
        """Long-running task."""
        while True:
            try:
                x = requests.post(self.API_ENDPOINT+'getsong', data={'guild': self.gid})
                l = x.json()
                if 'error' in l.keys():
                    self.progress.emit(l)
                if 'Config' in l.keys():
                    self.progress.emit(l['Config'][0])
            except Exception as e:
                print(e)
            time.sleep(2)

