class KeyboardThread(QObject):
    finished = pyqtSignal()
    progress = pyqtSignal(dict)
    def __init__(self):
        super(KeyboardThread, self).__init__()
        self.keybinds = Keybinds()
        self.keybinds.init_keybinds()

    def run(self):
        with Listener(on_press=self.on_press) as listener:
            listener.join()

